#define INCLUDE_QUICKFONT_H_

#define QF_NUM_GLYPHS 95
#define QF_GLYPH_WIDTH 6
#define QF_GLYPH_HEIGHT 11

#define QF_ATLAS_WIDTH (QF_NUM_GLYPHS * QF_GLYPH_WIDTH)
#define QF_ATLAS_HEIGHT QF_GLYPH_HEIGHT

static void qf_atlas_uv(char c, float *x0, float *y0, float *x1, float *y1) {
    if (c < 32 || c > 126) {
        c = ' ';
    }
    c -= 32;
    *x0 = (float)(c * QF_GLYPH_WIDTH) / (float)QF_ATLAS_WIDTH;
    *x1 = (float)((c+1) * QF_GLYPH_WIDTH) / (float)QF_ATLAS_WIDTH;
    *y0 = 0.0f;
    *y1 = 1.0f;
}

